import React from 'react';

const Input = props => {
  return (
    <div className='row'>
      <div className='col s3 m3 l3' />
      <div className='col s5 m5 l5'>
        <input
          type='number'
          value={props.req}
          onChange={props.one}
          style={{ height: 20, textAlign: 'center', marginLeft: 15 }}
        />
      </div>
      <div className='col s3 m3 l3' />
    </div>
  );
};

export default Input;
